import React from "react";

import Navigation from "../components/navigation";
import Footer from "../components/footer";
import LetsConnect from "../components/letsConnect";

const Home = () => {
  return (
    <>
      <main>
        <Navigation />
        <Footer />
        <LetsConnect />
      </main>
    </>
  );
};

export default Home;
